_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1868183","type":"CustomJS"},{"attributes":{"label":{"value":"Max Dd Dur. (1790 days)"},"renderers":[{"id":"1867962"}]},"id":"1867984","type":"LegendItem"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1868008","type":"BoxAnnotation"},{"attributes":{"fill_color":{"value":"blue"},"hatch_color":{"value":"blue"},"line_color":{"value":"blue"},"size":{"value":8},"x":{"value":1258},"y":{"value":0.1263786799999966}},"id":"1867911","type":"Scatter"},{"attributes":{"below":[{"id":"1867993"}],"center":[{"id":"1867996"},{"id":"1868000"},{"id":"1868017"}],"height":90,"left":[{"id":"1867997"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"1868022"},{"id":"1868028"}],"sizing_mode":"stretch_width","title":{"id":"1868216"},"toolbar":{"id":"1868009"},"toolbar_location":null,"width":null,"x_range":{"id":"1867798"},"x_scale":{"id":"1867989"},"y_range":{"id":"1867987"},"y_scale":{"id":"1867991"}},"id":"1867985","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1867805","type":"LinearScale"},{"attributes":{"line_color":"#1f77b4","li
